import { Routes, Router, Route, BrowserRouter } from "react-router-dom";
import HomeView from "Views/HomeView";


function App() {
  return (
    <BrowserRouter> 
    <Routes>
      <Route index element={<HomeView />} />
    </Routes>
  </BrowserRouter>
  );
}

export default App;
